import React, { useState } from "react";
import { Box, Paper, Typography, Tabs, Tab } from "@mui/material";
import { useForm } from "react-hook-form";

import BasicStaffDataGrid from "../../components/Staffs/StaffsCreate/BasicStaffDataGrid";
import FormFooter from "../../components/Staffs/StaffsCreate/FormFooter";

const StaffCreate = () => {
  const {
    register,
    handleSubmit,
    control,
    formState: { errors },
  } = useForm();

  const onSubmit = (data) => {
    // eslint-disable-next-line no-console
    console.log(data);
  };

  const [tabValue, setTabValue] = useState(0);

  const handleTabChange = (event, newTabValue) => {
    setValue(newTabValue);
  };

  return (
    <Box component="form" autoComplete="off" onSubmit={handleSubmit(onSubmit)}>
      <Tabs value={tabValue} onChange={handleTabChange}>
        <Tab label="Βασικά Στοιχεία" value={0} />
        <Tab label="Λοιπά Στοιχεία" value={1} />
        <Tab label="Στοιχεία Οικογενείας" value={2} />
      </Tabs>
      <Paper
        sx={{
          m: 4,
          width: "60rem",
          minWidth: "20rem",
        }}
        elevation={6}
      >
        <Box>
          <Typography
            variant="h2"
            fontWeight="bold"
            sx={{
              color: "#03074f",
              fontSize: "2rem",
              p: "20px 0px 10px 15px",
            }}
          >
            Στοιχεία Προσωπικού
          </Typography>
        </Box>
        <BasicStaffDataGrid
          control={control}
          errors={errors}
          register={register}
        />
        <FormFooter />
      </Paper>
    </Box>
  );
};

export default StaffCreate;
